import React from "react";
import dummyContacts from "../dummyData";

const Main = (props) => {
  const [contacts, setContacts] = UseState(dummyContacts);
  return (
    <div id="main">
      <div id="navbar">
        <div>Contact List</div>
      </div>
      <div id="container">
        {contacts.map((contact) => {
          return contact.name;
        })}
        ;
      </div>
    </div>
  );
};

export default Main;
